— Судороги — это внезапные сокращения мышц с временной блокировкой их расслабления. Как говорят в обиходе, «свело» или «заклинило». Если судорога не отпускает, она сопровождается острой болью.
Судороги могут возникать по разным причинам. Самая распространенная — резкое переохлаждение (например, при купании в холодной воде). Опытные пловцы знают приемы снятия мышечных спазмов, а у неопытного человека судорога может вызвать панику, угрожающую жизни.
При сексуальной близости судороги могут быть вызваны интенсивным оргазмом, при котором активно сокращаются мышцы ног, бедер, промежности и живота. Если такая судорога возникла раз или два, это не повод для беспокойства. А вот если это повторяется неоднократно, такое явление может быть связано с одним из перечисленных заболеваний:
— варикозное расширение вен, сопровождающееся отеками ног;
— сахарный диабет, при котором происходит поражение нервных окончаний конечностей;
— венозная недостаточность (при этом судорога может сводить не только икроножную мышцу, но и стопы и даже пальцы ног).
